TextFile CloseF(TextFile F)
{
  if (F != TextFileNull() && F != stdin && F != stdout && F != stderr) {
#ifdef XREADANDWRITEF
    xFileNode tmpFN = xFileNodes;
    xFileNode prevFN = xFileNodes;

    isAssign = 1;
    while (tmpFN && tmpFN->FilePtr != F) {
      prevFN = tmpFN;
      tmpFN = tmpFN->Next;
    }
    if (tmpFN) {
      free (tmpFN->NameOfFile);
      if (tmpFN == xFileNodes) {
        xFileNodes = tmpFN->Next;
      }
      else {
        prevFN->Next = tmpFN->Next;
      }
      free (tmpFN);
    }
#endif
    fclose(F);
  }
  return TextFileNull();
}

